    constructor(props) {
        super(props);

        this.state = {
            ads: []
        }
    }
    render() {
        return (
            <div>
                <h2 className="text-center"> Job Ads</h2>
    <div className="row">
        <table className= "table table-striped table-bordered">

            <thead>
            <tr>
                <th> Job ad Name</th>
                <th> Job ad description</th>
            </tr>
            </thead>
            <tbody>
            {
                this.state.ads.map()
            }
            </tbody>

        </table>
    </div>
            </div>
        )
    }
}

export default Ads
